import { useState } from "react"

const Form = () => {

    const [userData, setUserData] = useState({
        email: '',
        password: '',
    })

    return (
        <form>
            <h1>Welcome to the Rick And Morty App</h1>

            <label htmlFor="email" > Usuario: </label>
            <input name="email" type="email" placeholder="Ingrese su email" value={userData.email}></input>
            <hr/>
            <label htmlFor="password"> Contraseña: </label>
            <input name="password" type="password" placeholder="Ingrese su contraseña" value={userData.password}></input>
            <hr/>
            <button>Submit</button>

        </form>
    )

}

export default Form
